import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Здарова, парни!</h1>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/CschYgw5KZ0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
    </div>
  );
}

export default App;
